const theme = (isDarkMode) => ({
    palette: {
        mode: isDarkMode ? 'dark' : 'light',
        primary: {
            main: '#3f51b5',
        },
        secondary: {
            main: '#ffffff',
        },
        btnA: {
            main: '#A04C59'
        },
        btnB: {
            main: '#8C6252'
        },
        btnC: {
            main: '#4B4811'
        },
        btnD: {
            main: '#E98B43'
        },
        info: {
            main: '#303E29',
        },
    },
    breakpoints: {
        values: {
            xs: 0,
            sm: 600,
            md: 900,
            lg: 1200,
            xl: 1536,
        },
    },
});
export default theme;
